import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import ConfirmationBox from './ConfirmationBox'

class App extends Component {
  render() {
    return (
      <div className="App">
        <ConfirmationBox text="tomatoes" amount={5}/>
      </div>
    );
  }
}

export default App;
